import logo from './logo.svg';
import './App.css';

function App() {
  let edad=27;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
         <p>Mi edad es {edad}</p>
      </header>
    </div>
  );
}

export default App;
